def dijkstra(graph, src):
    dist = {node: float('inf') for node in graph}; dist[src] = 0
    pq = [(0, src)]
    while pq:
        d, u = heapq.heappop(pq)
        if d > dist[u]: continue
        for v, w in graph[u]:
            if dist[u] + w < dist[v]: dist[v] = dist[u] + w; heapq.heappush(pq, (dist[v], v))
    return dist

def bellman_ford(graph, V, src):
    dist = [float('inf')] * V; dist[src] = 0
    for _ in range(V-1):
        for u, v, w in graph:
            if dist[u] != float('inf') and dist[u]+w < dist[v]: dist[v] = dist[u]+w
    # Check negative cycles
    for u, v, w in graph:
        if dist[u] != float('inf') and dist[u]+w < dist[v]: return None
    return dist

