def kruskal(edges, V):
    parent = list(range(V))
    def find(x): return x if parent[x] == x else find(parent[x])
    def union(x, y): parent[find(x)] = find(y)
    edges.sort(key=lambda x: x[2])
    mst = []
    for u, v, w in edges:
        if find(u) != find(v): union(u, v); mst.append((u, v, w))
    return mst

