from collections import deque
def topo_sort(graph, V):
    indegree = [0] * V
    for u in range(V):
        for v in graph[u]: indegree[v] += 1
    q = deque([i for i in range(V) if indegree[i] == 0])
    result = []
    while q:
        u = q.popleft(); result.append(u)
        for v in graph[u]:
            indegree[v] -= 1
            if indegree[v] == 0: q.append(v)
    return result if len(result) == V else []  # Empty if cycle

def has_cycle(graph, V):
    WHITE, GRAY, BLACK = 0, 1, 2
    color = [WHITE] * V
    def dfs(u):
        color[u] = GRAY
        for v in graph[u]:
            if color[v] == GRAY: return True
            if color[v] == WHITE and dfs(v): return True
        color[u] = BLACK; return False
    return any(color[u] == WHITE and dfs(u) for u in range(V))

import heapq
def astar(graph, start, goal, h):
    pq = [(h(start), 0, start, [start])]
    visited = set()
    while pq:
        _, g, node, path = heapq.heappop(pq)
        if node == goal: return path
        if node in visited: continue
        visited.add(node)
        for neighbor, cost in graph[node]:
            if neighbor not in visited:
                heapq.heappush(pq, (g + cost + h(neighbor), g + cost, neighbor, path + [neighbor]))
    return []

def egg_drop(eggs, floors):
    dp = [[0]*(floors+1) for _ in range(eggs+1)]
    for f in range(1, floors+1): dp[1][f] = f
    for e in range(1, eggs+1): dp[e][0] = 0; dp[e][1] = 1
    for e in range(2, eggs+1):
        for f in range(2, floors+1):
            dp[e][f] = float('inf')
            for x in range(1, f+1):
                dp[e][f] = min(dp[e][f], 1 + max(dp[e-1][x-1], dp[e][f-x]))
    return dp[eggs][floors]

