def min_cuts(s):
    n = len(s)
    is_palindrome = [[False]*n for _ in range(n)]
    for i in range(n): is_palindrome[i][i] = True
    for length in range(2, n+1):
        for i in range(n-length+1):
            j = i + length - 1
            is_palindrome[i][j] = (s[i] == s[j]) and (length == 2 or is_palindrome[i+1][j-1])
    dp = [0] * n
    for i in range(n):
        if is_palindrome[0][i]: dp[i] = 0
        else:
            dp[i] = float('inf')
            for j in range(i):
                if is_palindrome[j+1][i]: dp[i] = min(dp[i], dp[j] + 1)
    return dp[n-1]

